%%%           Nicolas Kuehn, Linda Al Atik, Robert Youngs, and Robert Graves
%%%           apps.peer.berkeley.edu/publications/peer_reports/reports_2018/NGA-East_1MainReport_FINAL.pdf																			
%%% --------------------------------------------------------------------
%%% Instruction: 
%%%   1. Enter the values of the user-input parameters.
%%%       Model limits are given with each input parameters.
%%%   2. Run full script
%%%   3. Wait while script runs
%%%   4. A plot of the response spectra will open (you can copy and paste it elsewhere)
%%%   5. Result values are printed in Command Window (you can copy and paste them elsewhere)
%%% --------------------------------------------------------------------
%%%   Notes:
%%%       The Median and Sigma models are described in the report. 
%%%       The values are computed for Vs30=3000 (m/s)
%%%       Damping Ratio = 5%
%%%       This script only outputs the Weighted-Average Composite values for Median and Sigma.
%%%       The values for the individual components can be found in the Excel version of the NGA-East GMtool.
%%% --------------------------------------------------------------------
%%% Variables:
%%%   User-Input Parameters:
%%%       inMagnitude:    Event Magnitude. Range=4-8.2
%%%       inRrup:         Rupture Distance (km). Range=1-1500km
%%%       inSigmaType:    Type of Sigma: Ergodic or Single-Station
%%%       inNsigma:       Number of Standard Deviations (sigma)
%%%       inPeriodList:   Array of periods (sec) for computation. Range: 0.01-10, 'PGA','PGV', -1 (=PGA), -2 (=PGV)
%%%   Output Variables:
%%%     outDataTable:           Matlab Table with all in/out data matrix
%%%     outTlist:                   Array of Periods used for computuation (sec) -1 (=PGA), -2 (=PGV)
%%%     outMedianList:              Array of median PSA (g);
%%%     outSigmaList:               Array of Sigma;
%%%     outMedianMinusNSigmaList:   Array of Median - inNsigma*Sigma (g);
%%%     outMedianPlusNSigmaList:	Array of Median + inNsigma*Sigma (g);
%%% --------------------------------------------------------------------
%%% --------------------------------------------------------------------
