function Sigma = getSigma(thisFreq, inMagnitude, inRrup, inSigmaType)
    % code developed and written by Silvia Mazzoni
    %       smazzoni@ucla.edu, March 2020
    if lower(inSigmaType) == lower("ErgodicSigma")
        Sigma = getSigmaCompErg(thisFreq, inMagnitude, inRrup);
    else
        Sigma = getSigmaCompSS(thisFreq, inMagnitude, inRrup);
    end
end

