function SigmaCompSSi = getSigmaCompSSi(inMagnitude, S1, S2, S3, S4)
    % code developed and written by Silvia Mazzoni
    %       smazzoni@ucla.edu, March 2020
    if inMagnitude <= 4.5 
        SigmaCompSSi = S1;
    elseif inMagnitude <= 5.0 
        SigmaCompSSi = S1 + (S2 - S1) * (inMagnitude - 4.5) / 0.5;
    elseif inMagnitude <= 5.5 
        SigmaCompSSi = S2 + (S3 - S2) * (inMagnitude - 5.0) / 0.5;
    elseif inMagnitude <= 6.5 
        SigmaCompSSi = S3 + (S4 - S3) * (inMagnitude - 5.5) / 1.0;
    else
        SigmaCompSSi = S4;
    end 
end

